import React from 'react';
import img from '../assets/home-bg.jpeg';

function Home() {
  return (
    <div className="relative">
      <img src={img} alt="My Image" className="w-full h-auto opacity-80" />
      <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-center">
        <h1 className="flex text-4xl font-bold">Title</h1>
        <p className="flex text-lg">Some text goes here.</p>
      </div>
    </div>
  );
}

export default Home;
